import React from "react";
import { Row, Col } from "react-flexa";
import { Route, Switch, BrowserRouter } from "react-router-dom";
import NavigationBar from "./NavBar";
import WarehouseTable from "./Warehouses";

export const Content = () => {
  return (
    <BrowserRouter>
      <NavigationBar />
      <Row gutter="0px">
        <Col xs="100vw" gutter="0px">
          <Switch>
            <Route exact path="/warehouses" component={WarehouseTable} />
            {/* <Route exact path="/product-list" component={} />
            <Route exact path="/product-entry" component={} /> */}
          </Switch>
        </Col>
      </Row>
    </BrowserRouter>
  );
};
